// Dashboard.js
import React, { useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  Container,
  Drawer,
  List,
  ListItem,
  ListItemText,
  CssBaseline,
  IconButton,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import {
  Route,
  Routes,
  Link,
  useNavigate,
  useLocation,
} from "react-router-dom";

import RegisterPatient from "./RegisterPatient"; // Import your RegisterPatient component
import History from "./History"; // Import your History component
import Appointments from "./Appointments"; // Import your Appointments component
import Settings from "./Settings"; // Import your Settings component

function Dashboard() {
  const [open, setOpen] = useState(false);
  const navigate = useNavigate(); // Get the navigate function from react-router-dom
  const location = useLocation(); // Get the current location

  const toggleDrawer = () => {
    setOpen(!open);
  };

  // Function to navigate to the Register Patient route when the component mounts
  React.useEffect(() => {
    navigate("/register-patient");
  }, [navigate]);

  // Function to determine if a tab should be highlighted
  const isTabSelected = (tabName) => {
    return location.pathname === `/${tabName.toLowerCase().replace(" ", "-")}`;
  };

  return (
    <div>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="menu"
            onClick={toggleDrawer}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6">My Clinic</Typography>
        </Toolbar>
      </AppBar>
      <Drawer open={open} onClose={toggleDrawer}>
        <List>
          {[
            "Register Patient",
            "History",
            "Appointments",
            "Settings",
            "Logout",
          ].map((text, index) => (
            <ListItem
              button
              key={text}
              component={Link}
              to={`/${text.toLowerCase().replace(" ", "-")}`}
              className={isTabSelected(text) ? "selected-tab" : ""}
            >
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </Drawer>
      <Container>
        <Routes>
          <Route path="/register-patient" element={<RegisterPatient />} />
          <Route path="/history" element={<History />} />
          <Route path="/appointments" element={<Appointments />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/logout">{/* Log the user out and redirect */}</Route>
        </Routes>
      </Container>
    </div>
  );
}

export default Dashboard;
